import React,{useState} from 'react'

const User = (props) => {
    const [name, setName] = useState("Waliullah")
    const ChangeTo=()=>{
        setName("Habiba")
    }
    return (
        <div>
          Name : {props.name}
           <button onClick={ChangeTo}>Click me</button>
        </div>
    )
}

export default User
